import nubanner from './img/nubanner.jpg'
import minhyun from './img/minhyun.jpg'
export const banner_find = [
    {
        roomname: 'nuest',
        room_img: require("./img/nubanner.jpg")
    },
    {
        roomname: 'minhyun',
        room_img: minhyun
    },
    {
        roomname: 'x1official',
        room_img: require('./img/x1banner.jpg')
    },
    {
        roomname: 'not found'
    }
];
